import React from 'react'
import Link from 'next/link'

export default ({ isNativeLink, href, title }) => {
  return (
    !isNativeLink ?
      <Link href={ href }>
        <a>
          { title }
        </a>
      </Link> :
      <a href={ href }>{ title }</a>
  )
}
